import React from 'react';
import {Button, Container} from "react-bootstrap";

const Admin = () => {
    return (
        <Container style={{display: 'flex', flexDirection: 'column', marginTop: 100, gap: 20}}>
            <Button style={{width: 200, height: 30, borderRadius: 18, background: 'transparent', marginLeft: 50}}>Добавить тип</Button>
            <Button style={{width: 200, height: 30, borderRadius: 18, background: 'transparent', marginLeft: 50}}>Добаавить цвет</Button>
            <Button style={{width: 200, height: 30, borderRadius: 18, background: 'transparent', marginLeft: 50}}>Добавить продукт</Button>
        </Container>
    );
};

export default Admin;
